import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Navbar extends Component {
    render(){
        return (
            <nav>
                <Link to="/"> Egg Timer</Link>
                <ul>
                    <li>
                        <Link to="" >Users</Link>
                    </li>
                    <li>
                     <Link to="/users"> Create User</Link>
                    </li>
                </ul>
            </nav>
        );
    }
}
